import React, { useState, useEffect } from 'react';
import { receptionistAPI } from '../../api/endpoints';
import { showToast } from '../../components/Toast/Toast';

const Queue = () => {
  const [queue, setQueue] = useState([]);
  const [patientNames, setPatientNames] = useState([]);
  const [doctorNames, setDoctorNames] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    patientName: '',
    doctorName: '',
    department: ''
  });

  useEffect(() => {
    fetchQueue();
    fetchNames();
  }, []);

  const fetchNames = async () => {
    try {
      const [patientsRes, doctorsRes] = await Promise.all([
        receptionistAPI.getPatientNames(),
        receptionistAPI.getDoctorNames()
      ]);
      setPatientNames(patientsRes.data);
      setDoctorNames(doctorsRes.data);
    } catch (error) {
      console.error('Error fetching names:', error);
    }
  };

  const fetchQueue = async () => {
    try {
      const response = await receptionistAPI.getQueue();
      setQueue(response.data);
    } catch (error) {
      console.error('Error fetching queue:', error);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await receptionistAPI.addToQueue(formData);
      if (response.data.success) {
        showToast('Patient added to queue successfully!', 'success');
        setShowForm(false);
        setFormData({ patientName: '', doctorName: '', department: '' });
        fetchQueue();
      }
    } catch (error) {
      showToast('Failed to add patient to queue. Please try again.', 'error');
      console.error('Failed to add to queue:', error);
    }
  };

  return (
    <div className="queue">
      <div className="queue-header">
        <h2 style={{color: '#64ffda'}}>Patient Queue</h2>
        <button onClick={() => setShowForm(true)}>Add to Queue</button>
      </div>

      {showForm && (
        <form onSubmit={handleSubmit} className="queue-form">
          <select
            value={formData.patientName}
            onChange={(e) => setFormData({...formData, patientName: e.target.value})}
            required
          >
            <option value="">Select Patient</option>
            {patientNames.map(name => (
              <option key={name} value={name}>{name}</option>
            ))}
          </select>
          <select
            value={formData.doctorName}
            onChange={(e) => setFormData({...formData, doctorName: e.target.value})}
            required
          >
            <option value="">Select Doctor</option>
            {doctorNames.map(name => (
              <option key={name} value={name}>{name}</option>
            ))}
          </select>
          <select
            value={formData.department}
            onChange={(e) => setFormData({...formData, department: e.target.value})}
            required
          >
            <option value="">Select Department</option>
            <option value="eye">Eye</option>
            <option value="ent">ENT</option>
            <option value="skin">Skin</option>
          </select>

          <button type="submit">Add to Queue</button>
          <button type="button" onClick={() => setShowForm(false)}>Cancel</button>
        </form>
      )}

      <div className="queue-list">
        {queue.map((item, index) => (
          <div key={item.id} className="queue-item">
            <span className="queue-number">{index + 1}</span>
            <div className="queue-details">
              <h4>{item.patient_name}</h4>
              <p>Assigned Doctor: {item.doctor_name}</p>
              <p>Department: {item.department}</p>
              <p>Status: {item.status}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Queue;
